import React from "react";
import "./style.css";

// component : Board List Item 컴포넌트 //
export default function BoardListItem() {
  // render : Board List Item 컴포넌트 렌더링 //
  return (
    <div className="board-list-item">
      <div className="board-list-item-main-box">
        <div className="board-list-item-top">
          <div className="board-list-item-profile-box">
            <div
              className="board-list-item-profile-image"
              style={{
                backgroundImage: `url(https://png.pngtree.com/png-vector/20191115/ourmid/pngtree-beautiful-profile-line-vector-icon-png-image_1990469.jpg)`,
              }}
            ></div>
          </div>
          <div className="board-list-item-write-box">
            <div className="board-list-item-nickname">{"박상원"}</div>
            <div className="board-list-item-write-date">{"2024. 09. 18"}</div>
          </div>
        </div>
        <div className="board-list-item-middle">
          <div className="board-list-item-title">{"안녕하세요"}</div>
          <div className="board-list-item-content">
            {"안녕안녕안녕안녕안녕안녕안녕"}
          </div>
        </div>
        <div className="board-list-item-bottom">
          <div className="board-list-item-counts">
            {`댓글 0  ·  좋아요 0  ·  조회수 0`}
          </div>
        </div>
      </div>
      <div className="board-list-itme-image-box">
        <div
          className="board-list-item-image"
          style={{
            backgroundImage: `url(https://png.pngtree.com/png-vector/20191115/ourmid/pngtree-beautiful-profile-line-vector-icon-png-image_1990469.jpg)`,
          }}
        ></div>
      </div>
    </div>
  );
}
